INSERT INTO `geopos_terms` (`id`, `title`, `type`, `terms`) VALUES
(1, ' ', 1, '<p style=\"margin: 0 0 0 0px;\">1. <span lang=\"EN-US\" style=\"text-align: justify; text-indent: -18pt; font-size: 14px; line-height: 115%;\">Minimum 50% advance is\r\nmandatory to make an order.</span></p>\r\n<p class=\"MsoListParagraph\" style=\"text-align:justify;text-indent:-18.0pt;margin-top: -8px;mso-list:l0 level1 lfo1\">\r\n<span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0 0 0 0px;\"><span style=\"font-size: 14px;\">2. </span><span lang=\"EN-US\" style=\"text-align: justify; text-indent: -18pt; font-size: 14px; line-height: 115%;\">Submission of this bill is\r\nmandatory to receive the order.</span></p>\r\n\r\n<p class=\"MsoListParagraph\" style=\"text-align:justify;text-indent:-18.0pt;margin-top: -8px;\r\nmso-list:l0 level1 lfo1\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0 0 0 0px;\"><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 14px; line-height: 115%;\">3. </span><span lang=\"EN-US\" style=\"text-align: justify; text-indent: -18pt; font-size: 14px; line-height: 115%;\">In terms of exchange,\r\nclaims will be entertained only if the Suit(s) is/are in an unused condition\r\nand are brought within 7 days from the invoice date.</span></p>\r\n\r\n<p class=\"MsoListParagraph\" style=\"text-align:justify;text-indent:-18.0pt;margin-top: -8px;\r\nmso-list:l0 level1 lfo1\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0 0 0 0px;\"><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 14px; line-height: 115%;\">4. </span><span lang=\"EN-US\" style=\"text-align: justify; text-indent: -18pt; font-size: 14px; line-height: 115%;\">The procedure for a claim of\r\nlocal made fabric will take up to 1 month (T&C apply), while we offer No\r\nguarantee for imported fabric.</span></p>\r\n\r\n<p class=\"MsoListParagraph\" style=\"text-align:justify;text-indent:-18.0pt;margin-top: -8px;\r\nmso-list:l0 level1 lfo1\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0 0 0 0px;\"><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 14px; line-height: 115%;\">5. </span><span lang=\"EN-US\" style=\"text-align: justify; text-indent: -18pt; font-size: 14px; line-height: 115%;\">You can receive your order until 3 months from the delivery date, after that Dastaan will not\r\nresponsible for any losses incurred.</span></p>\r\n\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;mso-add-space:auto;\r\ntext-indent:-18.0pt;mso-list:l0 level1 lfo1\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%\"><o:p></o:p></span></p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;mso-add-space:auto;\r\ntext-indent:-18.0pt;mso-list:l0 level1 lfo1\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%\"><o:p></o:p></span></p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;mso-add-space:auto;\r\ntext-indent:-18.0pt;mso-list:l0 level1 lfo1\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%\"><o:p></o:p></span></p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;mso-add-space:auto;\r\ntext-indent:-18.0pt;mso-list:l0 level1 lfo1\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%\"><o:p></o:p></span></p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left:18.0pt;mso-add-space:auto;\r\ntext-indent:-18.0pt;mso-list:l0 level1 lfo1\"><span lang=\"EN-US\" style=\"font-size:14.0pt;line-height:115%\"><o:p></o:p></span></p>');
